  display: flex;

  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 20px;

  height: 450px;

}

  padding: 16px;
  width: 298px;
  height: 56px;
  background: #f9f8f9;
  border: 1px solid #d1cedc;
  border-radius: 8px;
}
.forgot-password .forgot-password__button-reset {
  padding: 12px 48px;
  gap: 12px;
  width: 301px;
  height: 56px;

  color: #fff;
  /* Main color */
  border: 3px solid #9141f6;
  border-radius: 8px;
}
.forgot-password .forgot-password__divider {
  display: flex;
  flex-direction: row;
  align-items: center;
  text-align: center;
  margin-top: 32px;

  and left sides of the text */
}
.forgot-password .forgot-password__divider:after, .forgot-password .forgot-password__divider:before {
  content: "";
  border: 1px solid #d7d4e0;
  flex: 1 1;
}
.forgot-password .forgot-password__or-wrapper {
  width: 55px;
  height: 40px;
  padding: 8px 16px;
  border: 1px solid #d7d4e0;
  border-radius: 37px;
  font-size: 14px;
  color: #666273;
}
.forgot-password .logo {
  width: 130.29px;
  height: 32px;
  margin-bottom: 1rem;
}
.forgot-password .forgot-password__span-login {
  opacity: 0.8;
  color: #9141f6;
  cursor: pointer;
}
.forgot-password .forgot-password__span-login:hover {
  opacity: 1;
}
.forgot-password .pi-check-circle {
  font-size: 3rem;
  color: green;
}
.forgot-password .forgot-password__message--success {
  width: 400px;
}
.forgot-password .p-invalid {
  border: 2px solid;
}
.forgot-password .form__icon--exclamation {
  color: #cd1414 !important;
}

    margin-top: 12px;
  }

    width: 300px;
  }

  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
}
.login .login__card {
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 20px;
  gap: 32px;
  z-index: 10;
  position: absolute;
  width: 522px;
  height: 760px;
  margin: auto;
  background-color: #fff;
  box-shadow: 0px 0px 4px rgba(0, 0, 0, 0.05), 0px 8px 8px rgba(0, 0, 0, 0.05), 0px 1px 4px rgba(0, 0, 0, 0.15);
  border-radius: 14px;
}
.login .login__input {
  padding: 16px;
  width: 298px;
  height: 56px;
  background: #f9f8f9;
  border: 1px solid #d1cedc;
  border-radius: 8px;
}
.login .login__remember-section {
  margin-bottom: 48px;
}
.login .login__remember-text {
  font-weight: 400;
  font-size: 14px;
  line-height: 16px;
  /* identical to box height, or 114% */
  /* Grey / Medium grey */
  color: #666273;
}
.login .login__button-login {
  opacity: 0.9;
  width: 160px;
  height: 56px;
  /* Main color */
  background: #9141f6 !important;
  border: 3px solid rgba(0, 0, 0, 0.2) !important;
  border-radius: 8px;
}
.login .login__button-login:hover {
  opacity: 1;
}
.login .login__button-media {
  padding: 12px 48px;
  gap: 12px;
  width: 301px;
  height: 56px;
  background: #ffffff;
  /* Main color */
  border: 3px solid #9141f6;
  border-radius: 8px;
}
.login .login__button-media .p-button-label {
  color: #9141f6;
}
.login .login__button-media .p-button-icon {
  color: blue;
}
.login .login__button-media:hover {
  background: #9141f6;
}
.login .media__wrapper__column {
  display: flex;
  flex-direction: column;
  gap: 32px;
}
.login .media__wrapper__row {
  display: flex;
  flex-direction: column;
  gap: 12px;
}
.login .login__divider {
  display: flex;
  flex-direction: row;
  align-items: center;
  text-align: center;
  margin-top: 32px;
  /* To show the lines on right
  and left sides of the text */
}
.login .login__divider:after, .login .login__divider:before {
  content: "";
  border: 1px solid #d7d4e0;
  flex: 1 1;
}
.login .login__or-wrapper {
  width: 55px;
  height: 40px;
  padding: 8px 16px;
  border: 1px solid #d7d4e0;
  border-radius: 37px;
  font-size: 14px;
  color: #666273;
}
.login .login__logo {
  width: 130.29px;
  height: 32px;
  margin-bottom: 1rem;
}
.login .login__span-register {
  opacity: 0.8;
  color: #9141f6;
  cursor: pointer;
}
.login .login__span-register:hover {
  opacity: 1;
}
.login .p-invalid {
  border: 2px solid;
}
.login .form__icon--exlamation {
  color: #cd1414 !important;
}
@media screen and (max-height: 900px), (max-width: 900px) {
  .login .login__card {
    width: 422px;
    height: 590px;
    gap: 0;
  }
  .login .login__remember-section {
    margin-bottom: 12px;
  }
  .login .login__button-login {
    width: 130px;
    height: 46px;
    /* Main color */
    background: #9141f6;
    border: 3px solid rgba(0, 0, 0, 0.2);
    border-radius: 8px;
  }
  .login .login__divider {
    margin-top: 12px;
  }
  .login .media__wrapper__column {
    display: flex;
    flex-direction: column;
    gap: 12px;
  }
  .login .media__wrapper__row {
    display: flex;
    flex-direction: row;
    gap: 12px;
  }
  .login .login__button-media {
    padding: 15px;
    gap: 12px;
    width: 143px;
    height: 56px;
    background: #ffffff;
    color: #9141f6;
    /* Main color */
    border: 3px solid #9141f6;
    border-radius: 8px;
  }
}

  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
}
.register .register__card {
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 20px;
  gap: 32px;
  z-index: 10;
  position: absolute;
  width: 522px;
  height: 700px;
  margin: auto;
  background-color: #fff;
  box-shadow: 0px 0px 4px rgba(0, 0, 0, 0.05), 0px 8px 8px rgba(0, 0, 0, 0.05), 0px 1px 4px rgba(0, 0, 0, 0.15);
  border-radius: 14px;
}
.register .register__input {
  padding: 16px;
  width: 298px;
  height: 56px;
  background: #f9f8f9;
  border: 1px solid #d1cedc;
  border-radius: 8px;
}
.register .register__button-register {
  width: 160px;
  height: 56px;
  margin-top: 32px;
  /* Main color */
  background: #9141f6 !important;
  border: 3px solid rgba(0, 0, 0, 0.2);
  border-radius: 8px;
}
.register .register__button-media {
  padding: 12px 48px;
  gap: 12px;
  width: 301px;
  height: 56px;
  background: #ffffff;
  color: #9141f6;
  /* Main color */
  border: 3px solid #9141f6;
  border-radius: 8px;
}
.register .media__wrapper__column {
  display: flex;
  flex-direction: column;
  gap: 32px;
}
.register .media__wrapper__row {
  display: flex;
  flex-direction: column;
  gap: 12px;
}
.register .register__divider {
  display: flex;
  flex-direction: row;
  align-items: center;
  text-align: center;
  margin-top: 32px;
  /* To show the lines on right
  and left sides of the text */
}
.register .register__divider:after, .register .register__divider:before {
  content: "";
  border: 1px solid #d7d4e0;
  flex: 1 1;
}
.register .register__or-wrapper {
  width: 55px;
  height: 40px;
  padding: 8px 16px;
  border: 1px solid #d7d4e0;
  border-radius: 37px;
  font-size: 14px;
  color: #666273;
}
.register .logo {
  width: 130.29px;
  height: 32px;
  margin-bottom: 1rem;
}
.register .register__span-signin {
  opacity: 0.8;
  color: #9141f6;
  cursor: pointer;
}
.register .register__span-signin:hover {
  opacity: 1;
}
.register .p-invalid {
  border: 2px solid;
}
.register .form__icon--exclamation {
  color: #cd1414 !important;
}
@media screen and (max-height: 900px), (max-width: 900px) {
  .register .register__card {
    width: 422px;
    height: 590px;
    gap: 0;
  }
  .register .register__button-register {
    width: 130px;
    height: 46px;
    /* Main color */
    background: #9141f6;
    border: 3px solid rgba(0, 0, 0, 0.2);
    border-radius: 8px;
  }
  .register .register__button-media {
    padding: 15px;
    gap: 12px;
    width: 143px;
    height: 56px;
    background: #ffffff;
    color: #9141f6;
    /* Main color */
    border: 3px solid #9141f6;
    border-radius: 8px;
  }
  .register .media__wrapper__column {
    display: flex;
    flex-direction: column;
    gap: 12px;
  }
  .register .media__wrapper__row {
    display: flex;
    flex-direction: row;
    gap: 12px;
  }
  .register .register__divider {
    margin-top: 12px;
  }

    box-sizing: border-box;
}

.p-hidden {
    display: none;
}

.p-hidden-space {
    visibility: hidden;
}

.p-hidden-accessible {
    border: 0;
    clip: rect(0 0 0 0);
    height: 1px;
    margin: -1px;
    overflow: hidden;
    padding: 0;
    position: absolute;
    width: 1px;
}

.p-hidden-accessible input,
.p-hidden-accessible select {
    transform: scale(0);
}

.p-reset {
    margin: 0;
    padding: 0;
    border: 0;
    outline: 0;
    text-decoration: none;
    font-size: 100%;
    list-style: none;
}

.p-disabled, .p-disabled * {
    cursor: default !important;
    pointer-events: none;
    -webkit-user-select: none;
            user-select: none;
}

.p-component-overlay {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
}

.p-overflow-hidden {
    overflow: hidden;
}

.p-unselectable-text {
    -webkit-user-select: none;
            user-select: none;
}

.p-scrollbar-measure {
    width: 100px;
    height: 100px;
    overflow: scroll;
    position: absolute;
    top: -9999px;
}
@keyframes p-fadein {
  0%   { opacity: 0; }
  100% { opacity: 1; }
}

.p-link {
	text-align: left;
	background-color: transparent;
	margin: 0;
	padding: 0;
	border: none;
    cursor: pointer;
    -webkit-user-select: none;
            user-select: none;
}

.p-link:disabled {
	cursor: default;
}

/* Non react overlay animations */
.p-connected-overlay {
    opacity: 0;
    transform: scaleY(0.8);
    transition: transform .12s cubic-bezier(0, 0, 0.2, 1), opacity .12s cubic-bezier(0, 0, 0.2, 1);
}

.p-connected-overlay-visible {
    opacity: 1;
    transform: scaleY(1);
}

.p-connected-overlay-hidden {
    opacity: 0;
    transform: scaleY(1);
    transition: opacity .1s linear;
}

/* React based overlay animations */
.p-connected-overlay-enter {
    opacity: 0;
    transform: scaleY(0.8);
}

.p-connected-overlay-enter-active {
    opacity: 1;
    transform: scaleY(1);
    transition: transform .12s cubic-bezier(0, 0, 0.2, 1), opacity .12s cubic-bezier(0, 0, 0.2, 1);
}

.p-connected-overlay-enter-done {
    transform: none;
}

.p-connected-overlay-exit {
    opacity: 1;
}

.p-connected-overlay-exit-active {
    opacity: 0;
    transition: opacity .1s linear;
}

/* Toggleable Content */
.p-toggleable-content-enter {
    max-height: 0;
}

.p-toggleable-content-enter-active {
    overflow: hidden;
    max-height: 1000px;
    transition: max-height 1s ease-in-out;
}

.p-toggleable-content-enter-done {
    transform: none;
}

.p-toggleable-content-exit {
    max-height: 1000px;
}

.p-toggleable-content-exit-active {
    overflow: hidden;
    max-height: 0;
    transition: max-height 0.45s cubic-bezier(0, 1, 0, 1);
}

.p-sr-only {
    border: 0;
    clip: rect(1px, 1px, 1px, 1px);
    clip-path: inset(50%);
    height: 1px;
    margin: -1px;
    overflow: hidden;
    padding: 0;
    position: absolute;
    width: 1px;
    word-wrap: normal !important;
}

.p-confirm-popup {
    position: absolute;
    top: 50%;
    left: 50%;
    margin-top: 10px;
}

.p-confirm-popup-flipped {
    margin-top: 0;
    margin-bottom: 10px;
}

.p-confirm-popup:after, .p-confirm-popup:before {
	bottom: 100%;
	left: calc(var(--overlayArrowLeft, 0) + 1.25rem);
	content: " ";
	height: 0;
	width: 0;
	position: absolute;
	pointer-events: none;
}

.p-confirm-popup:after {
	border-width: 8px;
	margin-left: -8px;
}

.p-confirm-popup:before {
	border-width: 10px;
	margin-left: -10px;
}

.p-confirm-popup-flipped:after, .p-confirm-popup-flipped:before {
    bottom: auto;
    top: 100%;
}

.p-confirm-popup.p-confirm-popup-flipped:after {
    border-bottom-color: transparent;
}

.p-confirm-popup.p-confirm-popup-flipped:before {
    border-bottom-color: transparent
}

.p-confirm-popup .p-confirm-popup-content {
    display: flex;
    align-items: center;
}

.p-contextmenu {
    position: absolute;
}

.p-contextmenu ul {
    margin: 0;
    padding: 0;
    list-style: none;
}

.p-contextmenu .p-submenu-list {
    position: absolute;
    min-width: 100%;
    z-index: 1;
}

.p-contextmenu .p-menuitem-link {
    cursor: pointer;
    display: flex;
    align-items: center;
    text-decoration: none;
    overflow: hidden;
    position: relative;
}

.p-contextmenu .p-menuitem-text {
    line-height: 1;
}

.p-contextmenu .p-menuitem {
    position: relative;
}

.p-contextmenu .p-menuitem-link .p-submenu-icon {
    margin-left: auto;
}

.p-contextmenu-enter {
    opacity: 0;
}

.p-contextmenu-enter-active {
    opacity: 1;
    transition: opacity 250ms;
}

.p-datascroller {
}

.p-datascroller .p-datascroller-header {
    text-align: center;
	padding: .5em .75em;
    border-bottom: 0 none;
}

.p-datascroller .p-datascroller-footer {
    text-align: center;
    padding: .25em .625em;
    border-top: 0px none;
}

.p-datascroller .p-datascroller-content {
    padding: .25em .625em;
}

.p-datascroller-inline .p-datascroller-content {
    overflow: auto;
}

.p-datascroller .p-datascroller-list {
    list-style-type: none; 
    margin: 0;
    padding: 0;
}
.p-datatable {
    position: relative;
}

.p-datatable table {
    border-collapse: collapse;
    min-width: 100%;
    table-layout: fixed;
}

.p-datatable .p-sortable-column {
    cursor: pointer;
    -webkit-user-select: none;
            user-select: none;
}

.p-datatable .p-sortable-disabled {
    cursor: auto;
}

.p-datatable .p-sortable-column .p-column-title,
.p-datatable .p-sortable-column .p-sortable-column-icon,
.p-datatable .p-sortable-column .p-sortable-column-badge {
    vertical-align: middle;
}

.p-datatable .p-sortable-column .p-sortable-column-badge {
    display: inline-flex;
    align-items: center;
    justify-content: center;
}

.p-datatable-responsive-scroll > .p-datatable-wrapper {
    overflow-x: auto;
}

.p-datatable-responsive-scroll > .p-datatable-wrapper > table,
.p-datatable-auto-layout > .p-datatable-wrapper > table {
    table-layout: auto;
}

.p-datatable-selectable .p-selectable-row,
.p-datatable-selectable-cell .p-selectable-cell {
    cursor: pointer;
}

.p-datatable-drag-selection-helper {
    position: absolute;
    z-index: 99999999;
}

/* Scrollable */
.p-datatable-scrollable .p-datatable-wrapper {
    position: relative;
    overflow: auto;
}

.p-datatable-scrollable .p-datatable-thead,
.p-datatable-scrollable .p-datatable-tbody,
.p-datatable-scrollable .p-datatable-tfoot {
    display: block;
}

.p-datatable-scrollable .p-datatable-thead > tr,
.p-datatable-scrollable .p-datatable-tbody > tr,
.p-datatable-scrollable .p-datatable-tfoot > tr {
    display: flex;
    flex-wrap: nowrap;
    width: 100%;
}

.p-datatable-scrollable .p-datatable-thead > tr > th,
.p-datatable-scrollable .p-datatable-tbody > tr > td,
.p-datatable-scrollable .p-datatable-tfoot > tr > td {
    display: flex;
    flex: 1 1;
    align-items: center;
}

.p-datatable-scrollable .p-datatable-thead {
    position: sticky;
    top: 0;
    z-index: 1;
}

.p-datatable-scrollable .p-datatable-frozen-tbody {
    position: sticky;
    z-index: 1;
}

.p-datatable-scrollable .p-datatable-tfoot {
    position: sticky;
    bottom: 0;
    z-index: 1;
}

.p-datatable-scrollable .p-frozen-column {
    position: sticky;
    background: inherit;
}

.p-datatable-scrollable th.p-frozen-column {
    z-index: 1;
}

.p-datatable-scrollable-both .p-datatable-thead > tr > th,
.p-datatable-scrollable-both .p-datatable-tbody > tr > td,
.p-datatable-scrollable-both .p-datatable-tfoot > tr > td,
.p-datatable-scrollable-horizontal .p-datatable-thead > tr > th
.p-datatable-scrollable-horizontal .p-datatable-tbody > tr > td,
.p-datatable-scrollable-horizontal .p-datatable-tfoot > tr > td {
    flex: 0 0 auto;
}

.p-datatable-flex-scrollable {
    display: flex;
    flex-direction: column;

      animation: p-progressbar-indeterminate-anim 2.1s cubic-bezier(0.65, 0.815, 0.735, 0.395) infinite;
}

    will-change: left, right;

    animation-delay: 1.15s;
}
@keyframes p-progressbar-indeterminate-anim {
  0% {
    left: -35%;
    right: 100%; }
  60% {
    left: 100%;
    right: -90%; }
  100% {
    left: 100%;
    right: -90%; }
}

  0% {

.p-treetable-auto-layout > .p-treetable-wrapper > table {
    table-layout: auto;
}

.p-treetable-selectable .p-treetable-tbody > tr {
    cursor: pointer;
}

.p-treetable-toggler {
    cursor: pointer;
    -webkit-user-select: none;
            user-select: none;
    display: inline-flex;
    align-items: center;
    justify-content: center;
    flex-shrink: 0;
    vertical-align: middle;
    overflow: hidden;
    position: relative;
}

.p-treetable-toggler + .p-checkbox {
    vertical-align: middle;
}

.p-treetable-toggler + .p-checkbox + span {
    vertical-align: middle;
}

/* Resizable */
.p-treetable-resizable > .p-treetable-wrapper {
    overflow-x: auto;
}

.p-treetable-resizable .p-treetable-thead > tr > th,
.p-treetable-resizable .p-treetable-tfoot > tr > td,
.p-treetable-resizable .p-treetable-tbody > tr > td {
    overflow: hidden;
}

.p-treetable-resizable .p-resizable-column {
    background-clip: padding-box;
    position: relative;
}

.p-treetable-resizable-fit .p-resizable-column:last-child .p-column-resizer {
    display: none;
}

.p-treetable .p-column-resizer {
    display: block;
    position: absolute !important;
    top: 0;
    right: 0;
    margin: 0;
    width: .5rem;
    height: 100%;
    padding: 0px;
    cursor:col-resize;
    border: 1px solid transparent;
}

.p-treetable .p-column-resizer-helper {
    width: 1px;
    position: absolute;
    z-index: 10;
    display: none;
}

/* Scrollable */
.p-treetable-scrollable-wrapper {
    position: relative;
}
.p-treetable-scrollable-header,
.p-treetable-scrollable-footer {
    overflow: hidden;
    border: 0 none;
}

.p-treetable-scrollable-body {
    overflow: auto;
    position: relative;
}

.p-treetable-virtual-table {
    position: absolute;
}

/* Frozen Columns */
.p-treetable-frozen-view .p-treetable-scrollable-body {
    overflow: hidden;
}

.p-treetable-unfrozen-view {
    position: absolute;
    top: 0px;
    left: 0px;
}

/* Reorder */
.p-treetable-reorder-indicator-up,
.p-treetable-reorder-indicator-down {
    position: absolute;
    display: none;
}

/* Loader */
.p-treetable .p-treetable-loading-overlay {
    position: absolute;
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: 1;
}

.p-virtualscroller {
    position: relative;
    overflow: auto;
    contain: strict;
    transform: translateZ(0);
    will-change: scroll-position;
    outline: 0 none;
}

.p-virtualscroller-content {
    position: absolute;
    top: 0;
    left: 0;
    /*contain: content;*/
    min-height: 100%;
    min-width: 100%;
    will-change: transform;
}

.p-virtualscroller-spacer {
    position: absolute;
    top: 0;
    left: 0;
    height: 1px;
    width: 1px;
    transform-origin: 0 0;
    pointer-events: none;
}

.p-virtualscroller-loader {
    position: sticky;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
}

.p-virtualscroller-loader.p-component-overlay {
    display: flex;
    align-items: center;
    justify-content: center;
}

.p-virtualscroller-loading-icon {
    font-size: 2rem;
}

* {
  box-sizing: border-box;
}

.p-component {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
  font-size: 1rem;
  font-weight: normal;
}

.p-component-overlay {
  background-color: rgba(0, 0, 0, 0.4);
  transition-duration: 0.2s;
}

.p-disabled, .p-component:disabled {
  opacity: 0.5;
}

.p-error {
  color: #a80000;
}

.p-text-secondary {
  color: #848484;
}

.pi {
  font-size: 1rem;
}

.p-link {
  font-size: 1rem;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
  border-radius: 3px;
}
.p-link:focus {
  outline: 0 none;
  outline-offset: 0;
  box-shadow: 0 0 0 0.2rem #8dcdff;
}

.p-component-overlay-enter {
  animation: p-component-overlay-enter-animation 150ms forwards;
}

.p-component-overlay-leave {
  animation: p-component-overlay-leave-animation 150ms forwards;
}

@keyframes p-component-overlay-enter-animation {
  from {
    background-color: transparent;
  }
  to {
    background-color: var(--maskbg);
  }
}
@keyframes p-component-overlay-leave-animation {
  from {
    background-color: var(--maskbg);
  }
  to {
    background-color: transparent;
  }
}
